EventHistoryPollQuery:
query EventHistoryPollQuery(
  $archetype: ArchetypeInputType
  $categories: [CollectionSlug!]
  $chains: [ChainScalar!]
  $collections: [CollectionSlug!]
  $count: Int = 10
  $cursor: String
  $eventTimestamp_Gt: DateTime
  $eventTypes: [EventType!]
  $identity: IdentityInputType
  $showAll: Boolean = false
) {
  assetEvents(after: $cursor, archetype: $archetype, categories: $categories, chains: $chains, collections: $collections, eventTimestamp_Gt: $eventTimestamp_Gt, eventTypes: $eventTypes, first: $count, identity: $identity, includeHidden: true) {
    edges {
      node {
        collection {
          ...CollectionCell_collection
          id
        }
        traitCriteria {
          ...CollectionCell_trait
          id
        }
        itemQuantity
        item @include(if: $showAll) {
          __typename
          relayId
          verificationStatus
          ...ItemCell_data
          ...item_url
          ... on AssetType {
            collection {
              ...CollectionLink_collection
              id
            }
            assetContract {
              ...CollectionLink_assetContract
              id
            }
          }
          ... on AssetBundleType {
            bundleCollection: collection {
              ...CollectionLink_collection
              id
            }
          }
          ... on Node {
            __isNode: __typename
            id
          }
        }
        relayId
        eventTimestamp
        eventType
        customEventName
        orderExpired
        ...utilsAssetEventLabel
        creatorFee {
          unit
        }
        devFeePaymentEvent {
          ...EventTimestamp_data
          id
        }
        fromAccount {
          address
          ...AccountLink_data
          id
        }
        perUnitPrice {
          unit
          eth
          usd
        }
        endingPriceType {
          unit
        }
        priceType {
          unit
        }
        payment {
          ...TokenPricePayment
          id
        }
        seller {
          ...AccountLink_data
          id
        }
        toAccount {
          ...AccountLink_data
          id
        }
        winnerAccount {
          ...AccountLink_data
          id
        }
        ...EventTimestamp_data
        id
      }
    }
  }
}

